INSERT INTO company(id,slug,data) VALUES ('e9f89daa-dd37-4595-a2ac-4bc4f6aaac88','paypal','{"name":"Pay Pal","website":"https://www.paypal.com","logo":"https://www.paypalobjects.com/webstatic/icon/pp258.png","description":"PayPal is the safer, easier way to pay and get paid online. The service allows anyone to pay in any way they prefer, including through credit cards, bank accounts, PayPal Smart Connect or account balances, without sharing financial information. PayPal has quickly become a global leader in online payment solutions with more than  million accounts worldwide. Available in 202 countries and 25 currencies around the world, PayPal enables global ecommerce by making payments possible across different locations, currencies, and languages.  PayPal has received more than 20 awards for excellence from the internet industry and the business community - most recently the 2006 Webby Award for Best Financial Services Site and the 2006 Webby People''s Voice Award for Best Financial Services Site.  Located in San Jose, California, PayPal was founded in 1998. PayPal (Europe) S.à r.l. et Cie, S.C.A. is a credit institution (or bank) authorised and supervised by Luxembourg’s financial regulator, the Commission de Surveillance du Secteur Financier (or CSSF). CSSF’s registered office: 283, route d’Arlon, L-1150 Luxembourg.","type":"0","location":"USA, California, San-Mateo","facebook":"paypal","twitter":"paypal","slug":"paypal","occupation":{"id":"9a65eed5-3933-4604-9796-54458a2c4906","name":"Software"},"industry":{"id":"b70e4e34-9b68-43af-8026-0f277b6b0d1b","name":"Deisgn"},"statistic":{"serviceProvidedCount":40,"collaboratingPeopleCount":158,"collaboratingCompanyCount":149},"keyWords":[{"id":"d555af6e-fd00-4872-8e2d-4547fa5d5f13","name":"Search"},{"id":"d555af6e-fd00-4872-8e2d-4547fa5d5f13","name":"Search"}]}');
INSERT INTO company(id,slug,data) VALUES ('728e5333-6f00-4de1-bf0f-1ace3374c47b','amazon','{"name":"Amazon","website":"https://www.amazon.com/","logo":"https://regnum.ru/uploads/pictures/news/2018/11/30/regnum_picture_154356037138044_normal.png","description":"When Amazon.com launched in 1995, it was with the mission “to be Earth’s most customer-centric company.” What does this mean? It''s simple. We''re a company that obsesses over customers. Our actions, goals, projects, programmes and inventions begin and end with the customer at the forefront of our minds. In other words, we start with the customer and work backwards. When we hit on something that is really working for customers, we commit to it in the hope that it will turn into an even bigger success. However, it’s not always as straightforward as that. Inventing is messy, and over time, it’s certain that we’ll fail at some big bets too.","type":"1","location":"USA, Texas, Houston","facebook":"amazon","twitter":"amazon","slug":"amazon","occupation":{"id":"9a65eed5-3933-4604-9796-54458a2c4906","name":"Software"},"industry":{"id":"4e5d6b07-2779-48b2-a6d8-b0249d058e9d","name":"Software"},"statistic":{"serviceProvidedCount":9,"collaboratingPeopleCount":142,"collaboratingCompanyCount":186},"keyWords":[{"id":"c658ba40-ac1d-47a9-b6dc-736ea840c8a0","name":"Trade"},{"id":"5b844f0c-de9a-4c14-91fb-978f9f865288","name":"Telephone"}]}');
INSERT INTO company(id,slug,data) VALUES ('974ae794-a929-434d-a939-b0fb49d8bf64','notion-labs-inc','{"name":"Notion Labs INC","website":"https://www.notion.so/","logo":"https://upload.wikimedia.org/wikipedia/commons/4/45/Notion_app_logo.png","description":"You probably have fifteen tabs open: one for email, one for Slack, one for Google Docs, and on, and on…But have you ever thought about where these work tools came from? Or why there are so many of them?To answer these questions, and to explain why we created Notion, we have to travel back in time.","type":"1","location":"USA, California, Los Angeles","facebook":"notion-labs-inc","twitter":"notion-labs-inc","slug":"notion-labs-inc","occupation":{"id":"cab8111d-3bf7-4c56-871d-37aa1e1a6361","name":"Consulting"},"industry":{"id":"id","name":"name"},"statistic":{"serviceProvidedCount":128,"collaboratingPeopleCount":99,"collaboratingCompanyCount":112},"keyWords":[{"id":"f2a3b949-a9ad-4bbb-a81b-43fba5e269b2","name":"Innovative"},{"id":"5b844f0c-de9a-4c14-91fb-978f9f865288","name":"Telephone"}]}');
INSERT INTO company(id,slug,data) VALUES ('95d3b063-8ab5-4abb-9887-4006db7a20a8','google','{"name":"Google","website":"https://www.google.com/","logo":"https://w7.pngwing.com/pngs/760/624/png-transparent-google-logo-google-search-advertising-google-company-text-trademark.png","description":"American multinational technology company that specializes in Internet-related services and products, which include online advertising technologies, a search engine, cloud computing, software, and hardware. It is considered one of the Big Five companies in the American information technology industry, along with Amazon, Facebook, Apple, and Microsoft. Google was founded on September 4, 1998, by Larry Page and Sergey Brin while they were Ph.D. students at Stanford University in California. Together they own about 14% of its publicly-listed shares and control 56% of the stockholder voting power through super-voting stock. The company went public via an initial public offering (IPO) in 2004. In 2015, Google was reorganized as a wholly-owned subsidiary of Alphabet Inc.. Google is Alphabet''s largest subsidiary and is a holding company for Alphabet''s Internet properties and interests. Sundar Pichai was appointed CEO of Google on October 24, 2015, replacing Larry Page, who became the CEO of Alphabet. On December 3, 2019, Pichai also became the CEO of Alphabet.","type":"1","location":"USA, Texas, Dallas","facebook":"google","twitter":"google","slug":"google","occupation":{"id":"id","name":"name"},"industry":{"id":"b70e4e34-9b68-43af-8026-0f277b6b0d1b","name":"Deisgn"},"statistic":{"serviceProvidedCount":39,"collaboratingPeopleCount":18,"collaboratingCompanyCount":90},"keyWords":[{"id":"d1c66ba1-9b04-4179-a816-15b129a7940a","name":"Electronic"},{"id":"d1c66ba1-9b04-4179-a816-15b129a7940a","name":"Electronic"}]}');
INSERT INTO company(id,slug,data) VALUES ('1e325d92-38b2-420a-a79e-4504110e0959','twitter','{"name":"Twitter","website":"https://twitter.com/","logo":"https://upload.wikimedia.org/wikipedia/ru/thumb/9/9f/Twitter_bird_logo_2012.svg/1261px-Twitter_bird_logo_2012.svg.png","description":"Twitter is an American microblogging and social networking service on which users post and interact with messages known as tweets. Registered users can post, like, and retweet tweets, but unregistered users can only read those that are publicly available. Users interact with Twitter through browser or mobile frontend software, or programmatically via its APIs. Prior to April 2020 services were accessible via SMS. The service is provided by Twitter, Inc., a corporation based in San Francisco, California, and has more than 25 offices around the world. Tweets were originally restricted to 140 characters, but the limit was doubled to 280 for non-CJK languages in November 2017. Audio and video tweets remain limited to 140 seconds for most accounts.","type":"1","location":"Russian , Utah, Moscow","facebook":"twitter","twitter":"twitter","slug":"twitter","occupation":{"id":"id","name":"name"},"industry":{"id":"6763e338-457a-408c-9935-63e26101227c","name":"Internet"},"statistic":{"serviceProvidedCount":51,"collaboratingPeopleCount":134,"collaboratingCompanyCount":37},"keyWords":[{"id":"d555af6e-fd00-4872-8e2d-4547fa5d5f13","name":"Search"},{"id":"fcb3cef6-2983-40de-b67a-a6e9c4805dd3","name":"Retail"}]}');
INSERT INTO company(id,slug,data) VALUES ('765ca9e5-1bc0-4c94-abad-63e75ab3aa7c','github','{"name":"Git Hub","website":"https://github.com/","logo":"https://github.githubassets.com/images/modules/logos_page/GitHub-Mark.png","description":"GitHub, Inc. is a provider of Internet hosting for software development and version control using Git. It offers the distributed version control and source code management (SCM) functionality of Git, plus its own features. It provides access control and several collaboration features such as bug tracking, feature requests, task management, continuous integration and wikis for every project. Headquartered in California, it has been a subsidiary of Microsoft since 2018.","type":"1","location":"USA, California, San Francisco","facebook":"github","twitter":"github","slug":"github","occupation":{"id":"9ac6ffa8-b109-4936-912c-956d0347fd7b","name":"Computer Systems Analyst"},"industry":{"id":"6763e338-457a-408c-9935-63e26101227c","name":"Internet"},"statistic":{"serviceProvidedCount":178,"collaboratingPeopleCount":13,"collaboratingCompanyCount":29},"keyWords":[{"id":"d555af6e-fd00-4872-8e2d-4547fa5d5f13","name":"Search"},{"id":"1763c0ec-8704-4b32-bcc4-590e6d27a3c0","name":"Device"}]}');
INSERT INTO company(id,slug,data) VALUES ('b7151133-a500-42e7-812c-419a0f7f0349','silicon-valley-innovation-center','{"name":"Silicon Valley Innovation Center","website":"https://siliconvalley.center/","logo":"https://storage.theoryandpractice.ru/tnp/uploads/image_logo/000/036/065/image/medium_1603e7bfd3.png","description":"We help traditional companies take the full advantage of the new technological revolution to transform themselves into  technology-powered businesses. Our clients include hundreds of top executives and board directors of Fortune 2000 companies, who are successfully transforming their companies. It’s time now for you to join this revolution","type":"1","location":"USA, California, San-Mateo","facebook":"silicon-valley-innovation-center","twitter":"silicon-valley-innovation-center","slug":"silicon-valley-innovation-center","occupation":{"id":"cab8111d-3bf7-4c56-871d-37aa1e1a6361","name":"Consulting"},"industry":{"id":"e6bff832-dd2a-4451-9e58-c7c008a7b0ba","name":"Transport"},"statistic":{"serviceProvidedCount":108,"collaboratingPeopleCount":150,"collaboratingCompanyCount":83},"keyWords":[{"id":"f2a3b949-a9ad-4bbb-a81b-43fba5e269b2","name":"Innovative"},{"id":"1763c0ec-8704-4b32-bcc4-590e6d27a3c0","name":"Device"}]}');
